The Weather Underground is a 2002 documentary film based on the rise and fall of the American  radical organization The Weathermen. The group's goal was to &quot;bring the (Vietnam) War home&quot; through acts of militant tactics.

Really good movie about a radical group trying to enact change in the government threw any means necessary.  They never killed anyone that im aware of.  I think some of them blew them selves up by accident.  If you liked V for vendetta its that kind of craziness only real people.
